import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";

import Home from "./pages/Home";
import CheckInfo from "./pages/CheckInfo";
import ShowOptions from "./pages/ShowOptions";
import DetailRoute from "./pages/DetailRoute";
import ScrollToTop from "./components/ScrollToTop";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <ScrollToTop />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/checkinfo" component={CheckInfo} />
          <Route path="/options" component={ShowOptions} />
          <Route path="/details" component={DetailRoute} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
